import React from "react";
import { mentorData } from "../data";

function Name(){
  return (
    <>
      <div className="name-container">
        {mentorData.map((data, key) => {
          return (
            <div key={key}>
              {data.Mentor +
                " , "}
            </div>
          );
        })}
      </div>
    </>
  );
}
export default Name;
